-- set colors
function pal(ci,col)
 local mem_loc = 0x03FC0 + 3*ci

 cfr = math.random(0,2)
 cfg = math.random(0,2)
 cfb = math.random(0,2)

 color_facs={cfr,cfg,cfb}
 color_b={math.random(-100,20),math.random(-30,50),math.random(-10,80)}

 for i=1,3 do
  -- poke(mem_loc+i-1, math.min(math.max(col[i]*color_facs[i]+color_b[i],0),255))
  poke(mem_loc+i-1, math.max(col[i]*color_facs[i]+color_b[i],0))
 end
end
function set_pal()
 for i=0,#palette-1 do
  pal(i,palette[i+1])
 end
end

-- burn
function burn(ci)
 if math.random() > noise_rate then
  ci = math.max(ci-1,burn_rate)
 else
  ci = ci-1
 end
 return ci
end

function get_dfacs()
 xf2=math.random(0,3)
 xf1=xf2-math.random(0,3)
 yf2=math.random(0,3)
 yf1=yf2-math.random(0,3)
 dfacs = {xf1,xf2,yf1,yf2}
 return dfacs
end

seed=42069
burn_rates={}
burn_rate=0
noise_rate=0
dfacs={}
dloops=0
frame=0
function init(seed)
 math.randomseed(seed)
 burn_rates = {-3,-2,-1,-1,0,0,0,0,0}
 burn_rate=burn_rates[math.random(#burn_rates)]
 noise_rate=math.random(1,100)/100
 dfacs=get_dfacs()
 dloops = math.random(500,15000)
 frame = 0
end
init(seed)
set_pal()
-- no cls???

function TIC()
 mx,my,left,middle,right,scrollx,scrolly=mouse()
 
if left then
 seed = seed - 1
 init(seed)
elseif right then
 seed = seed + 1
 init(seed)
end

 if frame%360==0 then
  math.randomseed(seed)
 end

 -- dither
for i=0,dloops do
 local x = math.random(-1,241)
 local y = math.random(-1,137)
 pix(x+math.random(dfacs[1],dfacs[2]),y+math.random(dfacs[3],dfacs[4]),burn(pix(x,y)))
end
	
	frame = frame + 1

end

